import { Typography } from "@mui/material";
import { Box, styled } from '@mui/material';




const UpNext = ({ movies }) => {
    return (
        <Box>
        <Typography>Up Next</Typography>
        {
          movies.map(movie => (
            <Box>
                img src = {'https://'}
                </Box>
          ))
        }
        </Box>
    )
}

export default UpNext;
